import { useLocation } from "react-router-dom";
export default function ViewProfile()
{
    const { state } = useLocation();
    const cabAgencyDetail = state ? state.cabAgencyDetail : null;
    console.log(cabAgencyDetail)
    return(
        <div>
            <h1>Cab Agency Profile</h1>
            <h3>{cabAgencyDetail.cabAgencyId}</h3>
            <h3>{cabAgencyDetail.cabAgencyName}</h3>
            <h3>{cabAgencyDetail.cabAgencyEmail}</h3>
            <h3>{cabAgencyDetail.cabAgencyPassword}</h3>

        </div>
    )
}
